import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    // Initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input by placeholder (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });
    // Type a product keyword (e.g., "iPhone")
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');

    // Wait for the search button using nth-of-type (since there are multiple .search-btn)
    const searchBtn = await page.waitForSelector('(//button[contains(@class,"search-btn")])[1]', { timeout: 5000 });
    await searchBtn.click();

    // Wait for the product card containing "iPhone" in the title (using text selector)
    await page.waitForSelector('text=Apple iPhone 15 Pro Max', { timeout: 5000 });

    // Click the product card using XPath to avoid conflicts with multiple cards
    const productCard = await page.waitForSelector('//div[contains(@class,"product-card")]//h3[contains(text(),"iPhone")]/ancestor::div[contains(@class,"product-card")]', { timeout: 5000 });
    await productCard.click();

    // Wait for the product detail modal by heading text
    await page.waitForSelector('h2.product-detail-title', { timeout: 5000 });

    // Screenshot before adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_detail.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_detail.png'));

    // Wait for the "Add to Wish List" button using button text
    const wishlistBtn = await page.waitForSelector('//button[contains(., "Add to Wish List")]', { timeout: 5000 });
    await wishlistBtn.click();

    // Wait for notification to appear (using notification class)
    await page.waitForSelector('.notification.success', { timeout: 5000 });

    // Screenshot after adding to wishlist
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_add_to_wishlist.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_add_to_wishlist.png'));

    // Go to wishlist page by clicking "Your Wish List" link (using nth occurrence to avoid header/footer)
    const wishlistLink = await page.waitForSelector('(//a[contains(text(),"Your Wish List")])[1]', { timeout: 5000 });
    await wishlistLink.click();

    // Wait for the wishlist page heading
    await page.waitForSelector('h2:text("Your Wish List")', { timeout: 5000 });

    // Screenshot of wishlist page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_page.png'));

    // Extract wishlist items (titles)
    const wishlistTitles = await page.$$eval('.wishlist-title', nodes => nodes.map(n => n.textContent.trim()));

    return {
      success: true,
      action: "Added product to wishlist and verified its presence in the wishlist page.",
      extractedData: {
        wishlistTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
